void
gdsl_x86_rreil_destroy(state_t s) {
gdsl_x86_rreil_reset_heap(s);
  char* heap;
  free(s->heap_base);
  /* free heap of GDSL constants */
  heap = s->const_heap_base;
  while (heap!=NULL) {
    char* prev = *((char**) heap);
    free (heap);
    heap = prev;
  }
  free(s);
}

